const SalaryTable = () => {
  staffList = STAFFS.map((item) => (
    <div className="">
      <img className="card-img-top mt-3" src={item.images} alt="Card image" />
      <div>
        <h4 className="card-item">{item.name}</h4>
        <p>
          <td>
            <Link to={'/staff/' + item.id}>Details</Link>
          </td>
        </p>
      </div>
    </div>
  ));
  return staffList;
};
export default SalaryTable;
